import axios from 'axios';
import React, { Component } from 'react';

class Profile extends Component {
    state = {
        post:[],
        success:''
    }
    componentDidMount(){
        axios.get('/rtqkaq2345akdker24/')
        .then(response =>{
            this.setState({
                post:response.data
            })
        })
        .catch(errors =>{
            this.setState({
                success:'Something went wrong!!'
            })
        })
    }
    render() { 
        console.log(this.state.post)
        return ( 
                <div>
                    Profile   
                </div>
                );
    }
}
 
export default Profile;
